import React from "react";

import imageCompression from "browser-image-compression";

import Card from "react-bootstrap/Card";

export default class imageCompressor extends React.Component {
  constructor() {
    super();
    this.state = {
      compressedLink:
        "http://navparivartan.in/wp-content/uploads/2018/11/placeholder.png",
      originalImage: "",
      originalLink: "",
      clicked: false,
      uploadImage: false,
      outputText: "",
      file : ""
    };
  }

  handle = e => {
    this.setState({
      file : "file path"
    });
  };

  changeValue = e => {
    this.setState({ [e.target.name]: e.target.value });
  };

  click = e => {
    e.preventDefault();
    this.setState({ clicked: true, outputText : "output text" });
    return 1;
  };

  render() {
    return (
      <div className="m-5">
        <div className="text-light text-center">
          <h1>Two Simple Steps</h1>
          <h3>1. Upload Wav File</h3>
          <h3>2. Click on Transcribe</h3>
        </div>



      </div>
    );
  }
}
